import React from 'react';
import {Route, Switch} from 'react-router-dom';
import LoginForm from './LoginForm';

const AppRouter = () => {
    return(
        <div className='page-view'>
            <Switch>
                {/* login */}
                <Route path='/login' component={LoginForm}/>  


            </Switch> 

        </div>
    )

}

export default AppRouter;
